import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  <div>
    <ExpenseItem
      title={props.info.expenses[0].title}
      amount={props.info.expenses[0].amount}
      date={props.info.expenses[0].date}
    ></ExpenseItem>
    <ExpenseItem
      title={props.info[1].title}
      amount={props.info.expenses[1].amount}
      date={props.info.expenses[1].date}
    ></ExpenseItem>
    <ExpenseItem
      title={props.info.expenses[2].title}
      amount={props.info.expenses[2].amount}
      date={props.info.expenses[2].date}
    ></ExpenseItem>
    <ExpenseItem
      title={expenses[3].title}
      amount={expenses[3].amount}
      date={expenses[3].date}
    ></ExpenseItem>
  </div>;
}

export default Expenses;
